/**
 * 에러 페이지
 */
 import styled from 'styled-components';
 import palette from '../lib/styles/palette';
 const NotFoundBlock = styled.div`
 position: absolute;
 left: 0;
 top: 0;
 bottom: 0;
 right: 0;
 background: ${palette.gray[2]};
 display: flex;
 flex-direction: column;
 justify-content: center;
 align-items: center;
 


`;
const Box = styled.div`
.logo-area {
  display: block;
  padding-bottom: 1rem;
  text-align: center;
  font-weight: bold;
  letter-spacing: 2px;
}
box-shadow: 0 0 8px rgba(0, 0, 0, 0.025);
padding: 2rem;
width: 360px;
background: white;
border-radius: 2px;
text-align: center;

`
const Button  =styled.button`
width:8rem;
height:3rem;
font-size:1rem;
margin-right:10px;
margin-left:10px;
color:#088A68;
background: #81F781;
&:hover{
  color:#81F781;
  background:#04B486;
}
&:active{
  color:#81F781;
  background:#088A68;
}
`
 const EditPostPage = () => {
   
   return (
   <NotFoundBlock>      
    <Box>
      <h1 className='logo-area'>Error 404!</h1>
      <p>페이지가 삭제되었거나 <br/>주소가 변경되었을 수 있습니다.</p>
      <Button>홈페이지 메인</Button>
      <Button>뒤로가기</Button>
    </Box>
    
   </NotFoundBlock>);
 };
 
 export default EditPostPage;
